import './styles/content.css';
import { get, find } from 'lodash';
var React = require('react');

class Content extends React.Component {

  constructor(props) {
    super(props);
  }

  createMatrix() {
    console.log('---- lllllll', get(this.props,'matrixContent',[]));
    let tiles = [];
    for(let row = 0; row < 3; row++) {
      for(let col = 0; col < 3; col++) {
        //let tileVal = this.props.matrixContent[row][col];
        console.log('---- ', get(this.props, ['matrixContent',row,col], ''));
        tiles.push(
          <div
            key={row+':'+col}
            className='tileContainer'
            onClick={() => this.props.handleTileClick(row, col, get(this.props,'player','player_1'))}
            >
              {this.props.matrixContent[row][col] || ''}
          </div>
        )
      }
    }
    return tiles;
  }

  render() {
    return(
      <div className='contentContainer'>
        <div className='gameBox'>
        {
          this.createMatrix()
        }
        </div>
      </div>
    );
  }
}

export default Content;
